Change-Id: Iaed5c446291ceaf89a06cc42f8c1c020fe95140c","distinct":true,"url":"https://api.github.com/repos/GulajavaMinistudio/tensorflow/commits/8040cd1cca688fdfd10f954ebc7870d3c5c1883f"},{"sha":"5f808811084219533fd58238b6e97577218808e6","author":{"name":"Saurabh Saxena","email":"a06419f1d29903870f8bf4863dbb6b72d69bfd5a@google.com"},"message":"Prototype for running eager op as a call op by transforming the elementary EagerOperation into a call EagerOperation right before kernel instantiation.
This happens low enough that this does not interfere with gradients and other transformation passes but high enough that we can make use of the kernel cache.
The generated FunctionDef is templated by leveraging `AttrValue.signature` so we do not need to rebuild it for different attribute values.
Attempting to wrap an op with private attrs or variadic inputs/outputs will raise an error.
This experiment can be enabled by calling `context.enable_run_eager_op_as_function()`.

